void IZigzagMatrix_f2r_forBody_s2e_forEnd::thread_ap_clk_no_reset_() {
    if ( ap_rst_n_inv.read() == ap_const_logic_1) {
        loop_dataflow_busy = ap_const_logic_0;
    } else {
        if (esl_seteq<1,2,2>(ap_const_lv2_2, loop_dataflow_output_count.read())) {
            loop_dataflow_busy = ap_const_logic_0;
        } else if (esl_seteq<1,1,1>(ap_const_logic_1, ap_start.read())) {
            loop_dataflow_busy = ap_const_logic_1;
        }
    }
    if ( ap_rst_n_inv.read() == ap_const_logic_1) {
        loop_dataflow_enable = ap_const_logic_0;
    } else {
        if ((esl_seteq<1,1,1>(loop_dataflow_enable.read(), ap_const_logic_0) && 
             esl_seteq<1,1,1>(ap_const_logic_1, ap_start.read()))) {
            loop_dataflow_enable = ap_const_logic_1;
        } else if ((esl_seteq<1,1,1>(ap_const_logic_1, loop_dataflow_enable.read()) && 
                    esl_seteq<1,2,2>(ap_const_lv2_2, loop_dataflow_input_count.read()))) {
            loop_dataflow_enable = ap_const_logic_0;
        }
    }
    if ( ap_rst_n_inv.read() == ap_const_logic_1) {
        loop_dataflow_input_count = ap_const_lv2_0;
    } else {
        if ((esl_seteq<1,1,1>(ap_const_logic_1, loop_dataflow_enable.read()) && 
             esl_seteq<1,2,2>(ap_const_lv2_2, loop_dataflow_input_count.read()))) {
            loop_dataflow_input_count = ap_const_lv2_0;
        } else if ((esl_seteq<1,1,1>(ap_const_logic_1, loop_dataflow_enable.read()) && 
                    esl_seteq<1,1,1>(ap_const_logic_1, dataflow_in_loop_U0_ap_ready.read()))) {
            loop_dataflow_input_count = (!loop_dataflow_input_count.read().is_01() || !ap_const_lv2_1.is_01())? sc_lv<2>(): (sc_biguint<2>(loop_dataflow_input_count.read()) + sc_biguint<2>(ap_const_lv2_1));
        }
    }
    if ( ap_rst_n_inv.read() == ap_const_logic_1) {
        loop_dataflow_output_count = ap_const_lv2_0;
    } else {
        if (esl_seteq<1,2,2>(ap_const_lv2_2, loop_dataflow_output_count.read())) {
            loop_dataflow_output_count = ap_const_lv2_0;
        } else if (esl_seteq<1,1,1>(ap_const_logic_1, dataflow_in_loop_U0_ap_done.read())) {
            loop_dataflow_output_count = (!loop_dataflow_output_count.read().is_01() || !ap_const_lv2_1.is_01())? sc_lv<2>(): (sc_biguint<2>(loop_dataflow_output_count.read()) + sc_biguint<2>(ap_const_lv2_1));
        }
    }
}

void IZigzagMatrix_f2r_forBody_s2e_forEnd::thread_ap_done() {
    if ((esl_seteq<1,2,2>(ap_const_lv2_2, loop_dataflow_output_count.read()) && 
         esl_seteq<1,1,1>(ap_const_logic_1, loop_dataflow_busy.read()))) {
        ap_done = ap_const_logic_1;
    } else {
        ap_done = ap_const_logic_0;
    }
}

